class Solution {

    /**
     * @param String[][] $access_times
     * @return String[]
     */
    function findHighAccessEmployees($access_times) {
        $accessLogs = [];
        foreach ($access_times as $entry) {
            $employee = $entry[0];
            $time = intval(substr($entry[1], 0, 2)) * 60 + intval(substr($entry[1], 2, 2));
            $accessLogs[$employee][] = $time;
        }

        $result = [];
        foreach ($accessLogs as $employee => $times) {
            sort($times);
            for ($i = 0; $i < count($times); $i++) {
                $count = 1;
                for ($j = $i + 1; $j < count($times); $j++) {
                    if ($times[$j] - $times[$i] < 60) {
                        $count++;
                    }
                }
                if ($count >= 3) {
                    $result[] = $employee;
                    break;
                }
            }
        }

        return $result;
    }
}
